css:
atom-panel.modal.nuclide-quick-open {
  margin-left: 0;
  max-width: none;
  position: absolute;
  width: auto;
  left: 65px;
  right: 65px;
}
.quick-open-result-item {
  cursor: pointer;
}
.omnisearch-modal {
  display: flex;
  flex-direction: column;
}
.omnisearch-search-bar {
  display: flex;
  flex-direction: row;
  align-items: center;
  justify-content: space-between;
}
.omnisearch-open-all {
  margin-left: 10px;
  margin-bottom: 10px;
}
.omnisearch-tabs {
  align-items: center;
  display: flex;
  flex-flow: row wrap;
}
.omnisearch-results {
  background: #0f1a27;
  min-height: 20em;
  overflow-y: scroll;
  padding: 10px;
  position: relative;
  max-height: calc(100vh - 195px);
}
.omnisearch-pane {
  flex-grow: 1;
}
.omnisearch-preview {
  align-items: center;
  background-color: #192b41;
  display: flex;
  flex-direction: row;
  justify-content: center;
}
.omnisearch-tabs {
  margin-top: 8px;
}
.omnisearch-tabs > .nuclide-tabs {
  width: 100%;
}
.omnisearch-tabs .key-binding {
  letter-spacing: 0;
  font-size: 0.9em;
  opacity: 0.5;
  transition: opacity 0.2s ease-out;
}
.omnisearch-tabs .key-binding:hover {
  opacity: 1;
}
.omnisearch-symbol-result-filename {
  color: rgba(153, 167, 184, 0.6);
  margin-left: 1em;
}
.quick-open-provider-count-badge {
  vertical-align: baseline;
  margin-left: 5px;
}
.quick-open-provider-item {
  cursor: pointer;
}
.quick-open-provider-item:hover span {
  color: #d5dbe2;
}
